import { Link } from "react-router-dom";
<div styleName="" />;

const NavBar = () => {
  return (
    <header>
      <div className="container">
        <Link to="/">
          <h1>BLoG</h1>
        </Link>
      </div>
      <div className="header-image">
        <img src="../public/blogimage.jpeg" alt="blog" />
      </div>
    </header>
  );
};

export default NavBar;
